import {Switch, Route} from "react-router-dom";

import HomePage from "./pages/HomePage";
import Nav from "./components/Nav";


function App() {
  return (
      <>
          <Nav/>
          <Switch>
            <Route path="/about">
              <HomePage />
            </Route>
            <Route path="/users">
              <HomePage />
            </Route>
            <Route path="/">
              <HomePage />
            </Route>
          </Switch>
      </>
  );
}

export default App;
